export default function PokemonList({ pokemons }){
    console.log(pokemons);
    return(
        <div>
            {pokemons.current_weather?.map((value, index) => (
                <div key={index}>
                    <p>{value.temp}</p>
                </div>
            ))}
        </div>
    );
}
